import React from 'react'
import { teamsData } from './teams-data'
import ReactTable from "react-table";  


function GradesView() {

    const columns = [{  
        Header: 'Team Name',  
        accessor: 'teamName'  
       },{  
       Header: 'Grade',  
       accessor: 'grade'  
       }]  
       
    return (
        <>
        <div className="teams-container">
        {teamsData.map((data, key) => {
            return (
                <>
                <div key={key}>
                    {
                        data.teamName +
                        " , " +
                        data.grade
                    }
                </div>
                 
                 </>
            )
        })}
    </div>
    <br/>
    <ReactTable  
                  data={teamsData}  
                  columns={columns}  
                  defaultPageSize = {2}  
                  pageSizeOptions = {[2,4, 6]}  
              />  
</>
    )
}

export default GradesView
